inline cFont *NEW_CFONTCALIBRI16()
{
    cImage        *img       = new cImage(CFONTCALIBRI16_WIDTH, CFONTCALIBRI16_HEIGHT, CFONTCALIBRI16_IMAGE_FORMAT);
    unsigned char *bytearray = new unsigned char[CFONTCALIBRI16_IMAGE_SIZE];

    memcpy(bytearray, CFONTCALIBRI16_BYTEARRAY, CFONTCALIBRI16_IMAGE_SIZE);
    img->setData(bytearray, CFONTCALIBRI16_IMAGE_SIZE, true);

    cFont *font = new cFont();
    font->m_charset.m_base       = CFONTCALIBRI16_CHARSET_BASE;
    font->m_charset.m_lineHeight = CFONTCALIBRI16_CHARSET_LINEHEIGHT;
    font->m_charset.m_width      = CFONTCALIBRI16_WIDTH;
    font->m_charset.m_height     = CFONTCALIBRI16_HEIGHT;
    font->m_charset.m_pages      = CFONTCALIBRI16_CHARSET_PAGES;
    for (int i=0; i<256; i++)
    {
        font->m_charset.m_chars[i].m_x        = CFONTCALIBRI16_CHARSET[8*i  ];
        font->m_charset.m_chars[i].m_y        = CFONTCALIBRI16_CHARSET[8*i+1];
        font->m_charset.m_chars[i].m_width    = CFONTCALIBRI16_CHARSET[8*i+2];
        font->m_charset.m_chars[i].m_height   = CFONTCALIBRI16_CHARSET[8*i+3];
        font->m_charset.m_chars[i].m_xOffset  = CFONTCALIBRI16_CHARSET[8*i+4];
        font->m_charset.m_chars[i].m_yOffset  = CFONTCALIBRI16_CHARSET[8*i+5];
        font->m_charset.m_chars[i].m_xAdvance = CFONTCALIBRI16_CHARSET[8*i+6];
        font->m_charset.m_chars[i].m_page     = CFONTCALIBRI16_CHARSET[8*i+7];
    }
    font->m_charset.preProcess();

    font->m_texture->setImage(img);

    return font;
}

